// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.15;

contract a {
    /*
    흔히들 비밀번호 만들 때 대소문자 숫자가 각각 1개씩은 포함되어 있어야 한다 
    등의 조건이 붙는 경우가 있습니다. 그러한 조건을 구현하세요.

    입력값을 받으면 그 입력값 안에 대문자, 
    소문자 그리고 숫자가 최소한 1개씩은 포함되어 있는지 여부를 
    알려주는 함수를 구현하세요.
    */

    //아스키 코드로 바꾸고 for문 돌려
    //if문으로 아스키코드 번호 대문자 : 41~5A까지 있는지?
    //소문자 : 61~7A 있는지?
    //숫자 : 31~39 있는지?

    function generatePW(string memory _pw) public pure returns(bytes memory){
        bool smallLetter;
        bool capitalLetter;
        bool number;
        return bytes(_pw);
    }
}

